var supportsTtf = (function( win ){
    if( !( "FontFace" in win ) ) {
        return false;
    }

    var f = new FontFace('t', 'url( "data:application/font-sfnt;base64," ) format( "truetype" )', {});
    f.load()['catch'](function() {});

    return f.status == 'loading' || f.status == 'loaded';
})( this );
